import React, { useState, useEffect } from 'react';
import axios from 'axios';

function CodeWarsScores (nameCW){
  const [dataCW, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('https://www.codewars.com/api/v1/users/Fenriz1349');
        setData(response.data);
      } catch (error) {
        console.error('Erreur lors de la récupération des scores de CodeWars : ', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
    <p>
      rang : {nameCW}
    </p> 
    </div>
  );
};

export default CodeWarsScores;
